  [],\n\t\"revision_timestamp\": \"2015-09-26T23:51:20.831281\",\n\t\"name\": \"calcofi-egg-counts\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fish egg counts and standardized counts
  for eggs captured in CalCOFI icthyoplankton nets (primarily vertical [Calvet or
  Pairovet], oblique [bongo or ring nets], and surface tows [Manta nets]). Surface
  tows are normally standardized to count per 1,000 m3 strained. Oblique tows are
  normally standardized to count per 10 m2 of surface sampled. This table includes
  all tows by species, even if zero eggs were captured for the species, i.e., negative
  tows. The \"Egg Counts Positive Tows\" table includes only tows where one or more
  eggs were captured for the species selected by the user.\",\n\t\"license_title\":
